b.put("templates/livebox/mixedRealitycheck.html",'<div><h3 trans>Reality Checks</h3><div class="settings-info-contain deposit-limit"><p trans>We offer you an opportunity to manage the amount of time spent playing, by setting up a Reality Check on your account.</p><p trans>Once you have saved your reality check time, you get a pop-up once this period has come up on the start of a casino session - placing a real money wager.</p><form class=registration-form ng-class="{\'disable-reality-form\' : working}" ng-init="realityCheck.selectedValue=($root.profile.active_time_in_casino !== null ? $root.profile.active_time_in_casino : \'0\')"><div class=form-text><label ng-repeat="option in conf.realityCheck.options track by $index"><input type=radio name=period ng-model=realityCheck.selectedValue value="{{ option.value }}"> <span ng-bind=option.name|translate></span></label></div><div class="change-button-container password"><div class=cashier-button><button ng-disabled="realityCheck.selectedValue==($root.profile.active_time_in_casino !== null ? $root.profile.active_time_in_casino : \'0\')" ng-show=!working trans ng-click=setRealityCheckInterval(realityCheck.selectedValue)>Save</button> <button disabled ng-show=working trans>Wait...</button></div></div></form></div></div>');
b.put("templates/livebox/mixedSelfExclusion.html",'<div><h3 trans>Self-Exclusion</h3><div class="settings-info-contain deposit-limit"><p trans>We will close your account, preventing access to your online account for the time period specified (between 6 months and 5 years).</p><p trans>Your account will only be re-opened if you contact us to request it after the Self-Exclusion period has expired.</p><p trans>Please note that you will be able to decrease your self-exclusion period or revoke it completely, only after seven days from your 1st request.</p><p trans>For further details please contact our support and refer to the Terms and Conditions and Responsible Gambling pages.</p><form class=registration-form><div class=form-text ng-init="$parent.periodValue= null"><label ng-repeat="option in conf.selfExclusion.options track by $index"><input type=radio name=period ng-click=selectPeriod(option.limit) ng-model=$parent.periodValue value="{{ $index }}"> <span ng-bind=option.name|translate></span></label></div><div class="change-button-container password"><div class=cashier-button><button ng-disabled=!periodValue ng-show=!working trans ng-click=setSelfExclusion(conf.selfExclusion.type)>Save</button> <button disabled ng-show=working trans>Wait...</button></div></div></form></div></div>');
b.put("templates/livebox/mixedTickets.html",'<div class="info-scroll-contain-b-new mixed-tickets-j" ng-controller=mixedTicketsCtrl no-animate><div class=any-tabs-wrapper-b><div class=group-tabs-wrapper><div class=first-level-history-tab><div class=mixed-tickets-search-j><input type=text placeholder="{{\'Ticket ID\' | translate}}" ng-model=searchTicketId></div></div></div></div><div class=balance-lightbox-j><section><div><ul><li><span trans>Ticket ID</span><span trans>Date</span></li><li class=ng-hide></li><li trans>Promo</li></ul><div class=mixed-tickets-content-j><table ng-init=loadTickets() ng-show="tickets.length > 0 && !isLoading"><tr ng-repeat="ticket in (tickets | filter:{ id: searchTicketId } )  track by $index"><td><span>ID:</span> {{ticket.id}}</td><td>{{ticket.date|formatDate: \'DD.MM.YY / HH:mm\'}}</td></tr></table><table ng-show="tickets.length == 0 && !isLoading"><tr><td><center trans>You do not have any tickets yet</center></td></tr></table><vbet-loader ng-show=isLoading></vbet-loader></div><div class=promotions-balance-j><div ng-controller=cmsPagesCtrl ng-init="gePageBanners(\'balance\',\'withdraw-banner-\' + $root.env.lang);"><vbet-big-slider class=big-slider-casino-directive ng-if=balanceTopBanners images=balanceTopBanners link-click-handler=openCBannerLink slider-template=true></vbet-big-slider></div></div></div></section></div></div>');
